import Papa from 'papaparse';

// Simplified CSV configuration
const CSV_CONFIG = {
  header: true,
  skipEmptyLines: true,
  transformHeader: (header) => header.trim(),
  transform: (value) => value?.trim(),
};

// Simplified function to fetch a specific patient's CSV file.
const fetchPatientCsvData = async (patientId) => {
  try {
    // Fetch individual patient CSV from the public folder
        const response = await fetch(`/synthetic_patients/${patientId}.csv?v=${new Date().getTime()}`);
    if (!response.ok) {
      throw new Error(`Failed to fetch CSV for ${patientId}: ${response.statusText}`);
    }
    const csvText = await response.text();
    const parsed = Papa.parse(csvText, CSV_CONFIG);
    if (parsed.errors.length > 0) {
      console.warn(`CSV parsing warnings for ${patientId}:`, parsed.errors);
    }
    return parsed.data;
  } catch (error) {
    console.error(`Error fetching or parsing CSV for ${patientId}:`, error);
    throw error;
  }
};

class DataService {
  /**
   * Fetches and processes data for a single patient.
   * This simplified version removes caching and fetches individual patient files.
   */
  static async getPatientData(patientId) {
    try {
      const patientRows = await fetchPatientCsvData(patientId);

      if (patientRows.length === 0) {
        throw new Error(`No data found for patient ${patientId}`);
      }

      // Process and structure the data
      const processedData = this.processPatientData(patientRows, patientId);
      return processedData;
    } catch (error) {
      console.error('Error fetching patient data:', error);
      throw error;
    }
  }

  /**
   * Processes the raw CSV rows for a patient.
   * This simplified version assumes the new multi-column data format is always present.
   */
  static processPatientData(rows, patientId) {
    const firstRow = rows[0];

    const patientInfo = {
      patientId,
      patientNumber: patientId,
      age: firstRow['Age'],
      gender: firstRow['Gender'],
      dataAvailable: 'May 2025'
    };

    // Process medications
    const detailedMedications = [];
    const conditionsSet = new Set();
    const medicationsRaw = [...new Set(rows.map(row => row['Medications']).filter(Boolean))];

    medicationsRaw.forEach(medString => {
        medString.split('; ').forEach(med => {
            const match = med.match(/(.*) \((.*)\)/);
            if (match) {
                const [, name, detailsStr] = match;
                const details = detailsStr.split(',').map(d => d.trim());
                detailedMedications.push({
                    name,
                    schedule: details[0] || '',
                    category: details[1] || '',
                    dosage: details.slice(2).join(', ') || ''
                });
            }
        });
    });

    // Process conditions
    const conditionsRaw = [...new Set(rows.map(row => row['Chronic_Conditions']).filter(Boolean))];
    conditionsRaw.forEach(conditionString => {
        conditionString.split(',').forEach(c => conditionsSet.add(c.trim()));
    });

    // Process all data types
    const glucoseData = this.processGlucoseData(rows);
    const bloodPressureData = this.processBloodPressureData(rows);
    const exerciseData = this.processExerciseData(rows);
    const moodData = this.processMoodData(rows);
    const painData = this.processPainData(rows);
    const sleepData = this.processSleepData(rows);
    const mealData = this.processMealData(rows);

    return {
      patientInfo: { 
        ...patientInfo, 
        detailedMedications, 
        conditions: Array.from(conditionsSet)
      },
      glucoseData,
      bloodPressureData,
      exerciseData,
      moodData,
      painData,
      mealData,
      sleepData,
      rawData: rows
    };
  }

  static processGlucoseData(rows) {
    return rows.flatMap(row => {
      const baseDate = new Date(row['Date']);
      const readings = [];

      // Check if multi-column format exists
      const hasMultiColumn = row['Glucose_1'] !== undefined;

      if (hasMultiColumn) {
        // Multi-column format
        for (let i = 1; i <= 4; i++) {
          const value = parseFloat(row[`Glucose_${i}`]);
          const timeStr = row[`Glucose_Time_${i}`];
          if (value > 0 && timeStr) {
            const [hours, minutes] = timeStr.split(':').map(Number);
            const date = new Date(baseDate);
            date.setHours(hours, minutes);
            readings.push({
              date,
              value,
              range: row[`Glucose_Range_${i}`],
              measurementType: row[`Glucose_Measurement_Type_${i}`]
            });
          }
        }
      } else {
        // Single-column format fallback
        const value = parseFloat(row['Glucose_Level']);
        if (value > 0) {
          // Generate a random time for the reading (since no timestamp available)
          const randomHour = Math.floor(Math.random() * 24);
          const randomMinute = Math.floor(Math.random() * 60);
          const date = new Date(baseDate);
          date.setHours(randomHour, randomMinute);

          // Determine range based on glucose value
          let range = 'in range';
          if (value < 70) range = 'below range';
          else if (value > 180) range = 'above range';

          readings.push({
            date,
            value,
            range,
            measurementType: 'Random'
          });
        }
      }

      return readings;
    });
  }

  static processBloodPressureData(rows) {
    return rows.flatMap(row => {
        const baseDate = new Date(row['Date']);
        const readings = [];

        // Check if multi-column format exists
        const hasMultiColumn = row['Systolic_1'] !== undefined;

        if (hasMultiColumn) {
            // Multi-column format
            for (let i = 1; i <= 4; i++) {
                const systolic = parseInt(row[`Systolic_${i}`]);
                const diastolic = parseInt(row[`Diastolic_${i}`]);
                const timeStr = row[`BP_Time_${i}`];
                if (systolic > 0 && diastolic > 0 && timeStr) {
                    const [hours, minutes] = timeStr.split(':').map(Number);
                    const date = new Date(baseDate);
                    date.setHours(hours, minutes);
                    readings.push({ 
                        date, 
                        systolic, 
                        diastolic, 
                        systolicType: row[`Systolic_Type_${i}`],
                        diastolicType: row[`Diastolic_Type_${i}`]
                    });
                }
            }
        } else {
            // Single-column format fallback
            const systolic = parseInt(row['Systolic_BP']);
            const diastolic = parseInt(row['Diastolic_BP']);
            if (systolic > 0 && diastolic > 0) {
                // Generate a random time for the reading
                const randomHour = Math.floor(Math.random() * 24);
                const randomMinute = Math.floor(Math.random() * 60);
                const date = new Date(baseDate);
                date.setHours(randomHour, randomMinute);

                // Determine BP categories based on values
                let systolicType = 'normal';
                let diastolicType = 'normal';
                if (systolic >= 180 || diastolic >= 120) {
                    systolicType = 'hypertensive crisis';
                    diastolicType = 'hypertensive crisis';
                } else if (systolic >= 140 || diastolic >= 90) {
                    systolicType = 'high';
                    diastolicType = 'high';
                } else if (systolic >= 130 || diastolic >= 80) {
                    systolicType = 'elevated';
                    diastolicType = 'elevated';
                }

                readings.push({ 
                    date, 
                    systolic, 
                    diastolic, 
                    systolicType,
                    diastolicType
                });
            }
        }

        return readings;
    });
  }

  static processExerciseData(rows) {
    const exerciseByDate = {};
    rows.forEach(row => {
        const date = new Date(row['Date']);
        const dateKey = date.toDateString();
        if (!exerciseByDate[dateKey]) {
            exerciseByDate[dateKey] = { date, walking: 0, aerobic: 0, strength: 0, balance: 0, other: 0, totalMinutes: 0 };
        }

        // Check if multi-column format exists
        const hasMultiColumn = row['Exercise_Type_1'] !== undefined;

        if (hasMultiColumn) {
            // Multi-column format
            for (let i = 1; i <= 3; i++) {
                const type = row[`Exercise_Type_${i}`]?.toLowerCase();
                const minutes = parseFloat(row[`Exercise_Minutes_${i}`]);
                if (type && minutes > 0) {
                    if (type.includes('walking')) exerciseByDate[dateKey].walking += minutes;
                    else if (type.includes('aerobic')) exerciseByDate[dateKey].aerobic += minutes;
                    else if (type.includes('strength')) exerciseByDate[dateKey].strength += minutes;
                    else if (type.includes('balance')) exerciseByDate[dateKey].balance += minutes;
                    else exerciseByDate[dateKey].other += minutes;
                    exerciseByDate[dateKey].totalMinutes += minutes;
                }
            }
        } else {
            // Single-column format fallback
            const type = row['Exercise_Type']?.toLowerCase();
            const minutes = parseFloat(row['Exercise_Minutes']);
            if (type && minutes > 0) {
                if (type.includes('walking')) exerciseByDate[dateKey].walking += minutes;
                else if (type.includes('aerobic')) exerciseByDate[dateKey].aerobic += minutes;
                else if (type.includes('strength')) exerciseByDate[dateKey].strength += minutes;
                else if (type.includes('balance')) exerciseByDate[dateKey].balance += minutes;
                else exerciseByDate[dateKey].other += minutes;
                exerciseByDate[dateKey].totalMinutes += minutes;
            }
        }
    });
    return Object.values(exerciseByDate).filter(d => d.totalMinutes > 0);
  }

  static processMoodData(rows) {
    return rows.filter(row => row['Mood']).map(row => ({
        date: new Date(row['Date']),
        mood: row['Mood'],
        category: row['Mood'] || 'neutral'
    }));
  }

  static processPainData(rows) {
    return rows.filter(row => row['Pain_Location'] && row['Pain_Level']).map(row => ({
        date: new Date(row['Date']),
        location: row['Pain_Location'].toLowerCase(),
        level: parseInt(row['Pain_Level'])
    }));
  }

  static processSleepData(rows) {
    return rows.filter(row => row['Sleep_Hours'] && row['Sleep_Quality']).map(row => ({
        date: new Date(row['Date']),
        hours: parseFloat(row['Sleep_Hours']),
        quality: row['Sleep_Quality'],
        qualityCode: parseInt(row['Sleep_Quality_Code'])
    }));
  }

  static processMealData(rows) {
    return rows.flatMap(row => {
      const baseDate = new Date(row['Date']);
      const meals = [];
      const mealTypes = ['Breakfast', 'Lunch', 'Dinner'];

      mealTypes.forEach(mealType => {
        const timeStr = row[`${mealType}_Time`];
        const contentsStr = row[`${mealType}_Contents`];

        if (timeStr && contentsStr) {
          const [hours, minutes] = timeStr.split(':').map(Number);
          const date = new Date(baseDate);
          date.setHours(hours, minutes);

          const contents = contentsStr.split('-').map(s => s.trim());

          meals.push({
            date,
            mealType,
            contents,
          });
        }
      });

      return meals;
    });
  }
}

export default DataService;
